        loader={ beginnerLoader }
      ></Route>

      <Route
        path='intermediate'
        element={ <Intermediate /> }
        loader={ intermediateLoader }
      ></Route> */}
    </Route>
  )
)

function App() {


  return (
    <>
      <RouterProvider router={router} />
    </>
  );
}

export default App;
